import React from 'react';
import MainBar from './MainBar';
import CardList from './CardList';
import {
  Container,
  Box,
  Grid
} from '@material-ui/core';

export default function Products({ data }) {
  return (
    <div>
      <MainBar hasLogo />
      <Container component="main" maxWidth="lg">
        <Box mt={26}>
          <CardList data={data} />
        </Box>
      </Container>
    </div>
  );
}
